import React from "react";
import { Routes, Route } from "react-router-dom";
import { PortfolioHome } from "../pages/PortfolioHome";

const AppRoutes = () => {
  return (
    <Routes>
      <Route path="/" element={<PortfolioHome />} />
    </Routes>
  );
};

export default AppRoutes;
